import React from 'react'

// import bootstrap components
import { Container, Row, Col } from 'react-bootstrap'


const Landing = () => {
  return (
    <Container>
      <Row>
        <Col> Shala</Col>
        <Col> Wala </Col>
        <Col> Bing </Col>
      </Row>>
    </Container>
  )
}
// exporting component
export default Landing
